def ansi_256color_control(**kwargs):
    '''
        ESC[ … 38;5;<n> … m Select foreground color
        ESC[ … 48;5;<n> … m Select background color
          0-  7:  standard colors (as in ESC [ 30–37 m)
          8- 15:  high intensity colors (as in ESC [ 90–97 m)
         16-231:  6 × 6 × 6 cube (216 colors): 16 + 36 × r + 6 × g + b (0 ≤ r, g, b ≤ 5)
        232-255:  grayscale from black to white in 24 steps
    '''
    if("fg" in kwargs):
        fg = kwargs['fg']
    else:
        fg = 255
    if("bg" in kwargs):
        bg = kwargs['bg']
    else:
        bg = 0
    control = '\033[38;5;' +str(fg) +"m" + '\033[48;5;' +str(bg) +"m"
    return(control)


import math
import elist.elist as elel

def square(x):
    return(x*x)

def distance(p1,p2):
    r1 = p1[0]
    g1 = p1[1]
    b1 = p1[2]
    r2 = p2[0]
    g2 = p2[1]
    b2 = p2[2]
    return(int(math.sqrt(square(r1-r2)+square(g1-g2)+square(b1-b2))))

def rgb2nearest(p):
    def map_func(ele,p):
        return(distance(ele,p))
    arr = elel.mapv(ANSI256_RGB_CLUT,map_func,[p])
    return(arr.index(min(arr)))


def ansi256_test(fg,**kwargs):
    if(isinstance(fg,int)):
        word = colorId2name(fg)
    else:
        word = fg
        fg = name2colorId(fg)
    default =  "\033[0m"
    s = ansi_256color_control(fg=fg,bg=0)+ str(fg)+":" +word+default
    if('rtrn' in kwargs):
        return(s)
    else:
        print(s)

def ansi256_help(*args,**kwargs):
    args = list(args)
    lngth = args.__len__()
    for i in range(0,lngth):
        if(isinstance(args[i],int)):
            pass
        else:
            args[i] = name2colorId(args[i])
    if(lngth == 0):
        for i in range(0,256):
            print(str(i) + ": " + ansi256_test(i,rtrn=True))
    else:
        for i in range(0,lngth):
            print(str(args[i])+": " + ansi256_test(args[i],rtrn=True))



class ANSI256():
    def __init__(self,*args,**kwargs):
        args = list(args)
        lngth = args.__len__()
        if(lngth>0):
            param = args[0]
            if(isinstance(param,int)):
                self.colorId = param
                self.hexString = colorId2hexString(param)
                self.rgb = colorId2rgb(param)
                self.hsl = colorId2hsl(param)
                self.name = colorId2name(param)
            elif(isinstance(param,str)):
                if(param[0]=="#"):
                    self.hexString = param
                    self.colorId = hexString2colorId(param)
                    self.rgb = hexString2rgb(param)
                    self.hsl = hexString2hsl(param)
                    self.name = hexString2name(param)
                else:
                    self.name = param
                    self.colorId = name2colorId(param)
                    self.hexString = name2hexString(param)
                    self.rgb = name2rgb(param)
                    self.hsl = name2hsl(param)
            elif(isinstance(param,dict)):
                if('r' in param):
                    self.rgb = param
                    self.colorId = rgb2colorId(param)
                    self.hexString = rgb2hexString(param)
                    self.hsl = rgb2hsl(param)
                    self.name = rgb2name(param)
                else:
                    self.hsl = param
                    self.colorId = hsl2colorId(param)
                    self.hexString = hsl2hexString(param)
                    self.rgb = hsl2rgb(param)
                    self.name = hsl2name(param)
            else:
                print("error,must init with one of the following colorId|hexString|rgb|hsl|name")
        else:
            if('colorId' in kwargs):
                self.colorId = kwargs['colorId']
                param = self.colorId
                self.hexString = colorId2hexString(param)
                self.rgb = colorId2rgb(param)
                self.hsl = colorId2hsl(param)
                self.name = colorId2name(param)
            elif('hexString' in kwargs):
                self.hexString = kwargs['hexString']
                param = self.hexString
                self.colorId = hexString2colorId(param)
                self.rgb = hexString2rgb(param)
                self.hsl = hexString2hsl(param)
                self.name = hexString2name(param)
            elif('rgb' in kwargs):
                self.rgb = kwargs['rgb']
                param = self.rgb
                self.colorId = rgb2colorId(param)
                self.hexString = rgb2hexString(param)
                self.hsl = rgb2hsl(param)
                self.name = rgb2name(param)
            elif('hsl' in kwargs):
                self.hsl = kwargs['hsl']
                param = self.hsl
                self.colorId = hsl2colorId(param)
                self.hexString = hsl2hexString(param)
                self.rgb = hsl2rgb(param)
                self.name = hsl2name(param)
            elif('name' in kwargs):
                self.name = kwargs['name']
                param = self.name
                self.colorId = name2colorId(param)
                self.hexString = name2hexString(param)
                self.rgb = name2rgb(param)
                self.hsl = name2hsl(param)
            else:
                print("error,must init with one of the following colorId|hexString|rgb|hsl|name")
    def show(self):
        ansi256_help(self.colorId)


